import React from "react";

export default function Services() {
  const services = [
    {
      title: "Digital Branding",
      desc: "We craft strong, memorable digital identities that connect your brand with your audience."
    },
    {
      title: "Content Creation",
      desc: "From short videos to visual campaigns, we create content that inspires, informs, and converts."
    },
    {
      title: "Social Media Management",
      desc: "We help brands grow with strategic content planning, audience engagement, and analytics."
    },
    {
      title: "Web Design & Optimization",
      desc: "Modern, mobile-friendly, and visually appealing websites designed for performance and impact."
    }
  ];

  return (
    <section className="min-h-screen bg-[#071226] text-white flex flex-col items-center justify-center px-8">
      <h1 className="text-4xl font-bold mb-6 text-center">Our Services</h1>
      <p className="text-gray-400 text-center mb-10 max-w-2xl">
        We provide creative solutions tailored to help your brand stand out online and engage with the right audience.
      </p>

      <div className="grid md:grid-cols-2 gap-6 max-w-4xl">
        {services.map((service, index) => (
          <div
            key={index}
            className="bg-[#0e1b35] p-6 rounded-2xl shadow-lg hover:shadow-xl hover:bg-[#12204a] transition duration-300"
          >
            <h3 className="text-2xl font-semibold mb-2">{service.title}</h3>
            <p className="text-gray-300">{service.desc}</p>
          </div>
        ))}
      </div>

      <div className="mt-10">
        <a
          href="https://wa.me/639166975338"
          target="_blank"
          rel="noopener noreferrer"
          className="px-6 py-3 bg-green-500 rounded-full text-white font-semibold hover:bg-green-600 transition duration-300"
        >
          Message Us on WhatsApp ðŸ’¬
        </a>
      </div>
    </section>
  );
}
